import React from 'react';
import ReactDOM from 'react-dom/client';
import { Outlet, Link } from "react-router-dom";
import './style/index.css';

import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import TaigaProjects from './pages/TaigaProjects';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div class="navbar bg-base-100">
      <Link class="btn btn-ghost text-xl" to='/'>Home</Link>
      <a class="btn btn-ghost text-xl" href='/taiga'>Projects</a>
      <a class="btn btn-ghost text-xl" href='/kimai'>Time</a>
    </div>

    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Home/>} />
        <Route path="/taiga" element={<TaigaProjects/>} />
      </Routes>
    </BrowserRouter> 
  </React.StrictMode>
);
